// ==UserScript==
// @name         Pjax Everywhere
// @name:zh-CN   Pjax加速网页访问
// @namespace    https://slaier.github.io/
// @version      1.3
// @author       slaier
// @description  enable pjax for some sites, speed up access to the site.
// @description:zh-cn 为一些网站开启pjax, 加速访问该网站。
// @include      https://git-scm.com/book/*
// @include      https://greasyfork.org/*/scripts*
// @require      https://cdn.jsdelivr.net/npm/jquery/dist/jquery.min.js
// @require      https://cdn.jsdelivr.net/npm/pjax/pjax.min.js
// @require      https://cdn.jsdelivr.net/npm/nprogress/nprogress.min.js
// @resource     nprogressCSS     https://cdn.jsdelivr.net/npm/nprogress/nprogress.css
// @grant        GM_addStyle
// @grant        GM_getResourceText
// @downloadURL https://update.greasyfork.org/scripts/376338/Pjax%20Everywhere.user.js
// @updateURL https://update.greasyfork.org/scripts/376338/Pjax%20Everywhere.meta.js
// ==/UserScript==

let loadingCSS = `
#loading-wrap{
    width: 100vw;
    height: 100vh;
    position: fixed;
    left: 0;
    top: 0;
    z-index: 1030;
    display: -webkit-box;
    display: -ms-flexbox;
    display: flex;
    -webkit-box-align: center;
        -ms-flex-align: center;
            align-items: center;
    -webkit-box-pack: center;
        -ms-flex-pack: center;
            justify-content: center;
    background: rgba(255,255,255,0.9);
}
#loading-anime{
    width: 80px;
    height: 80px;
    background-size: cover;
    -webkit-animation: loading 0.7s infinite;
            animation: loading 0.7s infinite;
    -webkit-animation-timing-function: step-end;
            animation-timing-function: step-end;
    background-image:url(data:image/png;base64,);
}
@-webkit-keyframes loading {
  0% {
	background-position: 0 0;
  }
  25%{
      background-position: 0 -80px;
  }
  50%{
      background-position: 0 -160px;
  }
  75% {
      background-position: 0 -240px;
  }
  100% {
      background-position: 0 0;
  }
}
@keyframes loading {
  0% {
	background-position: 0 0;
  }
  25%{
      background-position: 0 -80px;
  }
  50%{
      background-position: 0 -160px;
  }
  75% {
      background-position: 0 -240px;
  }
  100% {
      background-position: 0 0;
  }
}
`;

let config = {
  "config": [
    {
      "match": "https://git-scm.com/book/.*/.*/.*",
      "elements": "#content a",
      "selectors": [
        "#main",
        "title"
      ]
    },
    {
      "match": "https://greasyfork.org/.*/scripts.*",
      "elements": ".pagination a, #script-list-sort > ul > li > a, #script-list-filter > ul > li > a",
      "selectors": [
        "#browse-script-list",
        ".pagination",
        "#script-list-sort > ul",
        "#script-list-filter > ul",
        "title"
      ]
    },
  ]
};


function logging(msg){
  let options = { year: 'numeric', month: 'long', day: 'numeric', hour:"2-digit", minute:"2-digit", second:"2-digit"};
  let today = new Date();
  console.log(`${today.toLocaleDateString("defaults", options)} Pjax Everywhere: ${msg}`);
}


(function() {
    'use strict';

    // Your code here...
    // 加载nprogress的CSS
    let nprogressCSS = GM_getResourceText ("nprogressCSS");
    GM_addStyle (nprogressCSS);
    // loading 动画
    GM_addStyle (loadingCSS);
    let loading = '<div id="loading-wrap" style="display: none;"  ontouchmove="event.preventDefault()" onscroll="event.preventDefault()"><div id="loading-anime"></div></div>';
    $('body').append(loading);

    let configs = config['config'];
    for(let i = 0; i < configs.length; ++i){
        let arg = configs[i];
        let reg = new RegExp(arg['match'], "gi");
        if (reg.test(location.href)){
            let pjax = new Pjax({
              elements: arg["elements"],
              selectors: arg["selectors"]
            })
            console.log(` %c Pjax Everywhere %c https://slaier.github.io/ `, `color: #fadfa3; background: #23b7e5; padding:5px;`, `background: #1c2b36; padding:5px;`);
            logging(`matched ${arg['match']}`)
            break;
        }
    }
    document.addEventListener('pjax:send', function (){
        NProgress.start();
        $("#loading-wrap").show();
        logging('start loading...');
    });
    document.addEventListener('pjax:complete', function (){
        NProgress.done();
        $("#loading-wrap").fadeOut(0);
        logging('load success.');
    });
})();